import React, { Component } from "react";
import "./App.css";
import VideoChatContainer from "./VideoChatContainer";
import firebase from "firebase/app";

class App extends Component {
  render() {
    return (
      <div className="app">
        <h1>React Video Chat App</h1>
        <h2>WebRTC + Firebase</h2>
        <VideoChatContainer />
      </div>
    );
  }
}

export default App;
